export const Avatar = ({
  name = '',
  bg = '',
  color = '',
}: {
  name?: string
  bg?: string
  color?: string
}) => {
  return (
    <svg
      width="48"
      height="48"
      viewBox="0 0 55 55"
      fill="none"
      xmlns="http://www.w3.org/2000/svg"
    >
      <rect
        x="0.5"
        y="0.5"
        width="54"
        height="54"
        rx="54"
        fill={bg || '#091939'}
        stroke="#266395"
      />
      <text
        x="50%"
        y="50%"
        dominantBaseline="middle"
        textAnchor="middle"
        className="text-[18px] font-bold"
        fill={color}
      >
        {name}
      </text>
    </svg>
  )
}

